};

export class index extends Component {
  constructor(props) {
    super(props);

    this.state = { value: "" };
    this.state = { value1: "" };
  }

  handleChange = (value) => {
    this.setState({ value });
  };

  handleChange1 = (value1) => {
    this.setState({ value1 });
  };

